    public boolean isCanBeCover(Block block) {
        BlockCoverModule blockCoverModule = BLOCK_COVER_MODULE_HANDLER.getModule(block.getType().getBindGameObject());
        return blockCoverModule != null && blockCoverModule.isCanBeCover();
    }

